export default function CuRRent() {

 const [loading, setLoading] = React.useState(false);
 React.useEffect(() => {

  setLoading(true);
  setTimeout(() => {
   setLoading(false);
  }, 3600);

 }, []);

 return (
  <ReturnCurrent />
 );
};
